import image1 from "../assets/Breathe.png";
import image2 from "../assets/Happy.png";
import image3 from "../assets/Jumping.png";

const cards = [
  {
    id: 1,
    image1,
    title: "Expense Tracker",
    text: "Need to balance your budget?"
  },

  {
    id: 2,
    imgsrc: image2,
    title: "My Story",
    text: "Learn about my background"
  },

  {
    id: 3,
    imgsrc: "http://placekitten.com/300/200",
    title: "On the Cloud",
    text: "Apps hosted on AWS"
  }
];

export default cards;
